import "./App.css";
import Header from "./components/header/Header";
import SearchBar from "./components/header/searchBar";
import StateDropdown from "./components/header/StateDropdown";
import InputGroup from "react-bootstrap/InputGroup";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";

function App() {
	return (
		<div className="App">
			<SearchBar />
			{/* <Header /> */}
			{/* <StateDropdown /> */}
			<InputGroup
				className="mdb-5-search-input d-none d-md-flex input-group w-auto my-auto"
				type="search"
			>
				<Form.Control
					aria-label="Text input to search by park name"
					className=""
				/>
				<Button area-label="search" variant="primary" type="submit"></Button>
			</InputGroup>
		</div>
	);
}

export default App;
